import React, { Component } from 'react';
import configs from '../../../configs.json'

class AboutUs extends Component {
    constructor(props) {
        super(props)
        this.state = {
            highlight : this.props.highlight,
            colored   : this.props.plain,
            dark      : this.props.dark
        }
    } 
    render(){
        if (colored) {
            this.state.backgroundColor = configs.colors.primary
        } else {
            this.state.backgroundColor = configs.colors
        }
        return (
            <div className='container' style={{backgroundColor: this.state.highlight }} id='aboutus'>
                <div className='row section-row'>
                    <h3 className='orange-text'>Sobre Nos</h3>
                    <h6>Venha nos conhecer</h6>
                    <div className='col s8 left-align'>
                        <strong style={{color: process.env.REACT_APP_COLORS_DARKER}}><h5>{ configs.aboutus.title }</h5></strong>
                        <p>{ configs.aboutus.intro }</p>
                        {configs.services.map( s  =>
                            <h6 className='valign-wrapper'>
                                <i class="material-icons" style={{color:process.env.REACT_APP_COLORS_DARKER}}>{s.icon}</i><text className='service-item'>{ s.name }</text><br/>
                            </h6>
                        )}
                        <p>{ configs.aboutus.conclusion }</p>
                    </div>
                    <div className='col s4'>
                        <img className="responsive-img" style={{border: '3px solid' + process.env.REACT_APP_COLORS_DARKER, padding: '20px'}} src={require("../../../static/imgs/logo512.png")}/>
                    </div>
                </div>
            </div>
        )
    }
}

export default AboutUs
